import React from 'react';
import styled from 'styled-components';
import AppleLogo from '../assets/images/apple-brands.svg';

const Header = () => {
  const arr = [
    { title: '홈', link: '/' },
    { title: '아이폰', link: '/iphone' },
  ];
  return (
    <>
      <NavStyled>
        <UlStyled>
          <li>스토어</li>
          <li>Mac</li>
          <li>iPad</li>
          <li>iPhone</li>
          <li>Watch</li>
          <li>AirPods</li>
          <li>TV 및 홈</li>
          <li>Apple 독점 제공</li>
          <li>액세서리</li>
          <li>고객지원</li>
        </UlStyled>
      </NavStyled>
    </>
  );
};

const NavStyled = styled.nav`
  display: flex;
  justify-content: space-between;
  align-items: center;
  background-color: #313132;
`;

const UlStyled = styled.ul`
  display: flex;
  list-style: none;
  font-size: 12px;
  margin-left: 10%;
`;

export default Header;
